import React from 'react';
import ReactECharts from 'echarts-for-react';
// import 'echarts-gl';
class Page3 extends React.Component{

    constructor(props){
        super(props);
        this.state={
            option : {
                grid3D: {},
                xAxis3D: {
                    type: 'category'
                },
                yAxis3D: {
                    type: 'category'
                },
                zAxis3D: {},
                series: [{
                  type: 'scatter3D',
                  symbolSize: 50,
                  data: [[-1, -1, -1], [0, 0, 0], [1, 1, 1]],
                  itemStyle: {
                    opacity: 1
                  }
                }]
              }
        }
    }
    render() {
	
        const option =this.state.option;
        
         return( 
             <div>
        
            <ReactECharts
            option={option}
             style={{ height: 400 }}
           />
             </div>
         
        )
      }
}

export default Page3;
